function Wrapper(props) {
  return (
    <div
      style={{
        border: "2px solid black",
        padding: "10px",
        borderRadius: "8px",
      }}
    >
      {props.children}
    </div>
  );
}

function App() {
  return (
    <div>
      <Wrapper>
        <h2>This is a heading inside the wrapper</h2>
        <p>This paragraph is also wrapped.</p>
      </Wrapper>

      <Wrapper>
        <button>Click Me</button>
      </Wrapper>
    </div>
  );
}
